import React from "react";
import Navbar from "../../Components/Navbar/Navbar";

const Home = () => {
  const rendercomponent = () => {
    return (
      <>
        <Navbar />
        <div>Home</div>
      </>
    );
  };
  return rendercomponent();
};

export default Home;
